import scala.reflect.ClassTag
val detrendedRDD = tasjanRDD.map(p => {
    val (nyears, mdays, lat, lon) = (33, 31, 181, 286)
    var data2n = p("tasjan").copy
    var data1 = data2n.reshape(Array(nyears, mdays, lat, lon))
    val clim = data1.mean(0).reshape(Array(1, mdays, lat, lon))

    for(i <- 0 until nyears){
        data1(i -> (i + 1)) - clim
    }

    val data = data1.reshape(Array(nyears*mdays, lat, lon))
    val detrended = data.detrend(Array(0))
    detrended.insertVar("lat", p("lat").tensor)
    detrended.insertVar("lon", p("lon").tensor)
    detrended
})
